import { NavLink } from 'react-router-dom';
import './styles.css'
export const Navigation = () => {
  return (
    <div>
      <NavLink className={'.item'} to='/users'>Пользователи</NavLink>
      <NavLink className={'.item'} to='/todos'>Список дел</NavLink>
    </div>
  )
}
